def f(n):

    i = 2
    k = 1
    while i * i <= n:
        if n % i == 0:
            k = 0
            break
        i += 1
    if n < 10:
        return 1
    if k == 1:
        return len(str(n))
    k = int(n ** 0.5)
    for i in range(k, 1, -1):
        if n % i == 0:
            return max(len(str(i)), len(str(n // i)))


